import { Link } from "react-router-dom";
import "..";
function Navbar() {
    return (
        <>

            <header>
                <br />
                <h1>NETFLIX CLONE</h1>
                <nav>
                    <Link to="/">Home</Link>
                    <Link to="/">Page</Link>
                    <Link to="/">About </Link>
                    <Link to="/Favorite_Movie">Favorite Movie</Link>
                </nav>
            </header>
        </>

    )
}
export default Navbar;
